import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import "../css/navbar.css"
const Navbar = () => {
  return (
<nav class="navbar navbar-icon-top navbar-expand-lg navbar-dark bg-dark">
  <Link to="/" class="navbar-brand">Navbar</Link>
  <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
    <span class="navbar-toggler-icon"></span>
  </button>

  <div class="collapse navbar-collapse" id="navbarSupportedContent">
    <ul class="navbar-nav mr-auto">
      <li class="nav-item active">
        <Link to="/cari" class="nav-link" >
          <i class="fa fa-calculator "></i>
         Cari
          <span class="sr-only">(current)</span>
          </Link>
      </li>
      <li class="nav-item">
        <Link to="/fatura" class="nav-link" href="#">
          <i class="fa fa-envelope-o">
            <span class="badge badge-danger">11</span>
          </i>
         Fatura
        </Link>
      </li>
      <li class="nav-item">
        <Link class="nav-link " to="/tahsilat">
          <i class="fa fa-envelope-o">
            <span class="badge badge-warning">11</span>
          </i>
          Disabled
        </Link>
      </li>
     
    </ul>
    <ul class="navbar-nav ">
      <li class="nav-item">
        <Link class="nav-link" to="/muhasebe">
          <i class="fa fa-bell">
            <span class="badge badge-info">11</span>
          </i>
          Test
        </Link>
      </li>
      <li class="nav-item">
        <Link class="nav-link" to="/mizan">
          <i class="fa fa-globe">
            <span class="badge badge-success">11</span>
          </i>
          Test
        </Link>
      </li>
      <li class="nav-item">
        <Link class="nav-link" to="/mizan">
          <i class="fa fa-globe">
            <span class="badge badge-success">11</span>
          </i>
          Test
        </Link>
      </li>
      <li class="nav-item">
        <Link class="nav-link" to="/mizan">
          <i class="fa fa-globe">
            <span class="badge badge-success">11</span>
          </i>
          Test
        </Link>
      </li>
      <li class="nav-item">
        <Link class="nav-link" to="/mizan">
          <i class="fa fa-globe">
            <span class="badge badge-success">11</span>
          </i>
          Test
        </Link>
      </li>
    </ul>
    <form class="form-inline my-2 my-lg-0 ">
      <button class="btn btn-outline-success my-2 my-sm-18" type="submit" style={{"marginLeft":"100%"}}>Search</button>
    </form>
  </div>
</nav>
    //   <nav className="navbar navbar-expand-lg">
    //     <div className="container-fluid">
    //     <Link to="/" className="navbar-brand"> Yeni İmaj </Link>
